export const FilterBuilder = {
 operation : {
   like:"like",
   equals:"equals",
  },
  properties:{
   filed:"field",
   operation:"operation",
   value:"value"
  },
  generateUri
  

};

function generateUri(filters){
 var filter = "d";
 filters.forEach((rows) => {
      // filter.concat(filter == "" ? ",":"" +rows.filed+"/"+rows.operation+"/"+rows.value);
      filter.concat(rows.value)
  });
  console.log(filter);
}
